var Sdt, min;
var offSet = 0;
var zone = 0;

///// - Hintergrund mit Zeit-Funktion - /////

$(document).ready(setInterval(animate, 1000))	// Funktion "animate()" wird jede sekunde ausgeführt
function animate(){
	// Erstellen der Zeitvariablen
	var date = new Date();
		Sdt = date.getHours();
	var newSdt = Sdt + zone;
	if(newSdt==date.getHours()){
		// nichts
	} if(newSdt!=date.getHours()) {
		Sdt = (date.getHours()) + offSet + zone;
	}
	min = (date.getMinutes()) / 60;		// Minuten durch 60, erzeugt die Industrie-Minuten
	let fullFlow = ((min*10) + ((date.getSeconds()) / 60)*0.1)/10;		// Minuten und Sekunden werden zu einem Wert zusammengeführt zwischen 0 und 1

	// Farbwinkel = h
	// Variable "fullFlow" wird mit dem maximalen Farbwinkel multipliziert
	let h1 = fullFlow * 360;
	let h2 = fullFlow * 360 - 30;		// einen zweiten Farbwinkel für die Erstellung eines Hintergrundverlaufs

	// h3 Farbwinkel für die Schrift
	let h3 = fullFlow * 360 - 120;
	let h4 = fullFlow * 360 - 160;


	// Helligkeit = l
	// Sinus-Funktion zur Ermittlung des minimalen und maximalen Helligkeitswert gemessen an der Tageszeit
	let a = 40;									// Intervallausschlag // Intervallausschlag + minimale Helligkeit = maximale Helligkeit
	let b = (2 * Math.PI) / 48;					// Länge der Periode
	let c = 0;									// Verschiebung auf der X-Achse	// Tageszeit
	let d = 30;									// Verschiebung auf der Y-Achse	// minimale Helligkeit
	let x = Sdt + fullFlow;						// Variable zur Bestimmung von y // Std+min == mindestens 0, maximal 23,98
	let y = a * Math.sin(b * (x - c)) + d;		// die Sinus-Funktion
	// Ergebnis für die Helligkeit
	let l = y;

	// l2 für die Helligkeit der Schrift
	let l2 = -40 * Math.sin(((2 * Math.PI) / 48) * (x - (Math.PI/-1))) + 70;
	let l3 = 125 * Math.sin(((2 * Math.PI) / 48) * (x - (Math.PI/-1))) + 125;

	// Farbwerte für den Hintergrund werden erstellt
	let color1 = "hsl("+h1+", 100%, "+l+"%)";		// hsl (Farbwinkel: 360, Sättigung: 100%, Helligkeit: 100%);
	let color2 = "hsl("+h2+", 100%, "+l+"%)";
	let color3 = "hsl(" + h3 + ", 100%, " + l2 + "%)";
	let color4 = "hsl(" + h4 + ", 100%, " + l2 + "%)";


//////////////  H I N T E R G R U N D  //////////////////

	$("body").animate({
		backgroundColor: "linear-gradient(to bottom right, " + color1 + ", " + color2 + ")"
	}, 800);

	$("body").css("background-color","linear-gradient(to bottom right, " + color1 + ", " + color2 + ")");


//////////////  S C H R I F T F A R B E  //////////////////

	$(".font").css({"--fontColor1" : color3 , "--fontColor2" : color4});


//////////////  B O X E N  //////////////////

	$(".grid-helper , svg").css("background-color", "rgba(" + l3 + "," + l3 + "," + l3 + ",0.5)");


//	Prüfung Farben
//	console.log(color1);
//	console.log(color2);
//	console.log("Helligkeit bei: " + Math.round(l) + "%");
//	console.log("Farbwinkel bei: " + Math.round((fullFlow * 100) / 1) + "%");
//	console.log("//////////////////////////////////");
}


